INSERT INTO "Entry" (id, "userId", date, "rawText", "wordCount", "extractedData", "projectIds", "skillIds", "competencyIds", "isHighlight", sentiment, "createdAt", "updatedAt") VALUES ('cmgg9wa4p0001yq4avk9xwey8', '21TcQYaGrO', '2025-10-06T18:30:00.000Z', '📋 Today''s highlights:
